import React, { Component } from "react";

import "./index.css";
import { Menu } from "antd";

export default class Header extends Component {
  state = {
    current: "home"
  };

  render() {
    return (
      <header id="header">
        <nav>
          <Menu mode="horizontal">
            <Menu.Item>Home</Menu.Item>
          </Menu>
        </nav>
      </header>
    );
  }
}
